import { Footer } from "flowbite-react";
import Header from "../components/fragments/Header";
import Products from "../components/fragments/product";

const ProductDetailPage = () => {
    return (
        <>
           <Header/>
           <Products/>
           <Footer/>
        </>
    )
}

export default ProductDetailPage;
